≪訳あり≫<br>
※パッケージに色あせ等がある場合がございます。<br>
ご了承くださいませ。<br><br>大人気のお肌にやさしいジェリータイプのピーリング。<br>
ミックスフルーツの香り<br><br>
【商品特徴】<br>
うるおい成分たっぷりのピーリングジェリーです。<br>
くすみやざらつきの気になる部分をマッサージすると、ポロポロと老廃物（古い角質）が落ちて、お肌の透明感がよみがえります。<br>
ピーリング後はお化粧のりが違います。<br><br> 
【成分】<br>
水、グリセリン、カルボマー、ステアルトリモニウムクロリド、グリコシルトレハロース、加水分解水添デンプン、乳酸桿菌／セイヨウナシ果汁発酵液、ビルベリーエキス、サリックスニグラ樹皮エキス、サトウキビエキス、オレンジエキス、レモンエキス、サトウカエデ樹液、リンゴエキス、キイチゴエキス、オレンジ油、サリチル酸、リンゴ酸、酒石酸、グリコール酸、ＢＧ、香料 <br><br>
 桃谷順天館<br><br>

